import "./Nav.css";

const Nav = ({ openModal, addSpot }) => {
  return (
    <div className="nav-container">
      <h1>Kite</h1>
      <div className="right-0">
        <button className="bg-transparent hover:bg-blue-500 text-blue-700 font-semibold hover:text-white py-2 px-4 border border-blue-500 hover:border-transparent rounded">
          Add Spot
        </button>
        <button
          className="bg-blue-500 hover:bg-red-500 text-white font-bold py-2 px-4 rounde"
          onClick={() => {
            openModal(true);
          }}
        >
          Sign out
        </button>
      </div>
    </div>
  );
};

export default Nav;
